// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AgeVerification {
    struct User {
        string name;
        uint256 birthYear;
    }

    mapping(address => User) private users;

    function registerUser(string memory _name, uint256 _birthYear) public {
        users[msg.sender] = User(_name, _birthYear);
    }

    function isEligible(address _user) public view returns (bool) {
        uint256 currentYear = block.timestamp / 31556952 + 1970;
        return currentYear - users[_user].birthYear >= 18;
    }

    function getUser(address _user) public view returns (string memory, uint256) {
        User memory user = users[_user];
        return (user.name, user.birthYear);
    }
}
